import Link from 'next/link'
import { Component } from 'react'
import styles from '../styles/Home.module.css'


class Home extends Component {
  constructor() {
    super()
  }

  render(h) {
    return (
      <div>

        <Link href="/">Back</Link>


      </div>

    );
  }
}

export default Home;
